import React, {useState} from "react";
import {TextInput, StyleSheet, View, Text, SafeAreaView, ScrollView, TouchableOpacity} from 'react-native'
import Icon from 'react-native-vector-icons/FontAwesome';
import {useNavigation} from '@react-navigation/native';
import {Switch} from '@rneui/themed';
import {Formik} from "formik";
import * as yup from "yup";
import {validateCedula} from "../../utils/validators";
import * as ImagePicker from 'expo-image-picker';
import {Button, Image} from "react-native";
import axiosClient from "../../config/axiosConfig";
import axios from "axios";

const Register = () => {
    const analizar = <Icon name='check' size={20} color="white"/>;
    const [image, setImage] = useState(null)
    const pickImage = async () => {
        let result = await ImagePicker.launchImageLibraryAsync();
        if (!result.canceled) {
            setImage(result.uri);
        }
    }


    const navigation = useNavigation();
    const handleSignIn = async (values) => {
        if (image === null) {
            return
        }
        const data = new FormData()
        data.append('image', {
            uri: image.uri,
            type: 'image/jpeg', // or photo.type
            name: 'testPhotoN'
        })
        data.append('cedula','1234567890')
        data.append('nombre','pablo')
        data.append('edad',20)
        data.append('temperatura',20)
        // for (const key in values) {
        //     data.append(key, values[key])
        // }
        console.log(data)
        try {
            const response = await axios.post('http://127.0.0.1:8000/api/predict', data)
            console.log(response)
        } catch (e) {
            console.error(e)
        }
        setImage(null)
    };

    const registerSchema = yup.object({
        cedula: yup.string()
            .required('Cedula is required')
            .test("validate-cedula", "Verificar Cedula", c => validateCedula(c))
            .length(10),
        nombre: yup.string()
            .required(),
        edad: yup.number()
            .moreThan(0)
            .lessThan(120)
            .required(),
        temperatura: yup.number()
            .required()
            .test('decimal', 'Must be 2 decimal places',
                value => (value + "").match(/^\d+(\.\d{2})?$/),
            )
    })
    const registerInitialValues = {
        cedula: '',
        nombre: '',
        edad: '',
        temperatura: '',
        dolor_cabeza: false,
        conjuntivitis: false,
        malestar_general: false,
        ganglios_hinchados: false,
        tos: false,
        moqueo: false,
        dolor_garganta: false,
        diarrea: false,
        vomito: false,
        nauseas: false,
        comenzon: false,
        perdida_apetito: false,
        dolor_tragar: false,
        hinchazon: false,
        hinchazon_boca: false,
        dolor_abdominal: false,
        escalofrio: false,
        perdida_gusto: false,
        dolor_dentadura: false,
        cara: false,
        torso: false,
        cabeza: false,
        extremidades_superiores: false,
        extremidades_inferiores: false,
        genitales: false,
        manos: false,
        boca: false,
        pies: false
    }

    return (
        <SafeAreaView style={styles.safeArea}>
            <ScrollView>
                <View style={styles.container}>
                    <View>
                        <Text style={styles.title}>REGISTRO SÍNTOMAS</Text>
                    </View>

                    <View>
                        <Text style={styles.text}>Datos paciente:</Text>

                        <Formik initialValues={registerInitialValues} onSubmit={(values, actions) => {
                            // actions.resetForm()
                            handleSignIn(values)
                        }}
                                validationSchema={registerSchema}
                        >
                            {({
                                  handleChange, values,
                                  handleSubmit, handleBlur,
                                  errors, touched, setFieldValue
                              }) => (
                                <View>

                                    <TextInput style={styles.password}
                                               placeholder="Cédula"
                                               value={values.cedula}
                                               onChangeText={handleChange('cedula')}
                                               onBlur={handleBlur('cedula')}/>
                                    <Text style={styles.errorText}>{touched.cedula && errors.cedula}</Text>
                                    <TextInput style={styles.password}
                                               placeholder="Nombres y Apellidos"
                                               value={values.nombre}
                                               onChangeText={handleChange('nombre')}
                                               onBlur={handleBlur('nombre')}/>
                                    <Text style={styles.errorText}>{touched.nombre && errors.nombre}</Text>

                                    <TextInput style={styles.password}
                                               placeholder="Edad"
                                               keyboardType={'numeric'}
                                               value={values.edad}
